import React from 'react'
import st from './Dialogs.module.css'
import {NavLink} from "react-router-dom"

const DialogItem = (props) => {
    return (
        <div className={st.item}>
            <NavLink to={'/messages/'+props.id} activeClassName={st.active}>{props.name}</NavLink>
        </div>
    )
}

const Message = (props) => {
    return (
        <div className={st.message_item}>{props.item}</div>

    )
}

const Dialogs = (props) => {
    let myUsers = [
        {id: '1', name: 'Elena'},
        {id: '2', name: 'Alice'},
        {id: '3', name: 'Sergei'},
        {id: '4', name: 'Irina'},
        {id: '5', name: 'Tamara'}
    ]


    return (
    <div className={st.dialogs}>
        <div className={st.dialogs_items}>
            {myUsers.map((element) => {
                return (
                    <DialogItem name={element.name} id={element.id}/>
                )
            })}

        </div>
        <div className={st.messages}>
            <Message item='Hello Elena'/>
            <Message item='Hello Alice'/>
            <Message item='Hello Sergei'/>
            <Message item='Hello Irina'/>
            <Message item='Hello Tamara'/>
        </div>
    </div>
)
}
export default Dialogs
